import Vue from 'vue'
import Router from 'vue-router'
import login from "../views/login/Login.vue";
import success from "../views/login/Success.vue";
import error from "../views/login/Error.vue";
import regitster from "@/views/login/Regitster.vue";
import home from "../views/home/Home.vue"
import user_home from "../views/user/UserHome.vue"

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: home
    },
    {
      path: '/login',
      name: 'Login',
      component: login
    },
    {
      path: '/Success',
      name: 'success',
      component: success
    },
    {
      path: '/Error',
      name: 'error',
      component: error,
      hidden: true
    },
    {
      path: '/Register',
      name: 'register',
      component: regitster
    },
    {
      path: '/UserHome',
      name: 'userhome',
      component: user_home
    }
  ]
})
